import React from "react";
import App from "../App.css";

export const Navbar = () => {
  return (
    <>
      <div>
        <nav className="navbar bg-body-tertiary">
          <div className="container">
            <a className="navbar-brand" href="#">
              <img src="logo.png" alt="Bootstrap" width={60} height={60} />
            </a>
          </div>
        </nav>
      </div>
    </>
  );
};
